import { Routes } from 'react-router-dom';
import './App.css';
import { BrowserRouter, Route } from 'react-router-dom';
import Home from './Components/HomeComponent/Home';
import Navbar from './Components/NavbarComponent/Navbar';
import Header from './Components/HeaderComponent/Header';
import About from './Components/NavbarComponent/About';
import Contact from './Components/NavbarComponent/Contact';
import Deals from './Components/NavbarComponent/Deals';
import Mobiles from './Components/NavbarComponent/Mobiles';
import Electronics from './Components/NavbarComponent/Electronics';
import Furniture from './Components/NavbarComponent/Furniture';
import Appliances from './Components/NavbarComponent/Appliances';
import Soon from './Components/NavbarComponent/Soon';
import Under99 from './Components/NavbarComponent/Under99';

function App() {
  return (
    <>
      <div className="App">
        <BrowserRouter>
          <Header />
          <Navbar />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/deals" element={<Deals />} />
            <Route path="/mobiles" element={<Mobiles />} />
            <Route path="/fashion" element={<Fashion />} />
            <Route path="/electronics" element={<Electronics />} />
            <Route path="/furniture" element={<Furniture />} />
            <Route path="/appliances" element={<Appliances />} />
            <Route path="/soon" element={<Soon />}/>
            <Route path="under99" element={< Under99/>} />
            </Routes>
            </BrowserRouter>

          </div>
        </>
        );
}

        export default App;
